import React from "react";
import { Card } from "../../UI/Card.styled";
import { ImageCard } from "../../UI/ImageCard.styled";
const NavBar = ({ UI }) => {
  return (
    <Card
      mg={"1rem 7.5%"}
      height={"2rem"}
      width={"85%"}
      bd={"1px solid red"}
      dp={"grid"}
      gridC={"25% 35% 40%"}
      //   ovfx={"hidden"}
    >
      <Card bd={"1px solid red"} ovfyx={"none"}>
        <ImageCard src={UI.userIcon} heigth={"1.7rem"} width={"1.7rem"} />
      </Card>
      <Card bd={"1px solid red"}></Card>
      <Card bd={"1px solid red"}></Card>
    </Card>
  );
};

export default NavBar;
